import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2 className='sign'>掲示板</h2>
        <a className='make' href='google.com'>スレッドを作成</a>
      </header>
      <body>
        予定を表示
      </body>
    </div>
  );
}

export default App;
